import React from "react";
import "../../styles/Loading.css";

function Loading() {
  return (
    <div>
      <img
        src="https://upload.wikimedia.org/wikipedia/commons/b/b1/Loading_icon.gif"
        alt="Loading"
      />
      <p>Cargando tu busqueda</p>
    </div>
  );
}

export default Loading;
